var snapLinks=new function(){this.convertToAsync=function(n,e){n.addEventListener("click",function(t){t.preventDefault(),window.snapLoader.get(t.target.href).then(function(n){e(n,t)})})}},snapLoader=new function(){this.get=function(t){return fetch(t).then(function(n){return n.text().then(function(n){return(new DOMParser).parseFromString(n,"text/xml")}).catch(function(n){console.error("SNAP: Error trying to read respose text",n)})}).catch(function(n){console.error("SNAP: Error trying to fetch URL "+t,n)})}},snapSelectors=new function(){this.findForms=function(n){return n.querySelectorAll("form[data-snap]")},this.findLinks=function(n){return n.querySelectorAll("a[data-snap]")},this.findElementsWithTarget=function(n){return n.querySelectorAll("[data-snap-target]")}},snap=new function(){this.load=function(){document.addEventListener("DOMContentLoaded",this.convertLinksToAsync(document.body))},this.convertLinksToAsync=function(n){for(var t=window.snapSelectors.findLinks(n),e=0,o=t.length;e<o;e++)window.snapLinks.convertToAsync(t[e],window.snap.onElementLoaded)},this.onElementLoaded=function(n,t){var e=window.snapSelectors.findElementsWithTarget(n);if(null==e||0===e.length)t.target.parentNode.replaceChild(n.documentElement,t.target);else for(var o=0,r=e.length;o<r;o++)e[o]}};window.snap.load();